             }

     }


  render() 
{




     return(
      <div >
            <h1> {this.state.person}</h1>      
            <h2> {this.state.bio} </h2>        
            <h2> {this.state.profession}</h2>  
            <h2> {this.state.fullName}</h2>    
      </div> 
    )
  }
 }
